window.bookSummaryJSON = "<p>It's all fun and games to them - especially when someone gets hurt.</p> <p>One god of mischief and mayhem.</p> <p>One god of fur and fang.</p> <p>And the god of death himself.</p> <p>They've all been out to get me since the school year began, but this semester, the Rabbit's got some tricks up her sleeve.</p> <p>It's time to take these three vicious gods down a peg, or 10, and there's no better route to revenge than directly through the heart.</p> <p>I just have to make sure I don't get caught up in the twisted game myself.</p>"; 
